import React from 'react';
import { View, Text, Image, ScrollView, TextInput } from 'react-native';
import { StyleSheet, ImageBackground } from 'react-native';
import { Platform } from 'react-native-web';
import './background.jpg';

const styles = StyleSheet.create({
  container: {
    alignItems: 'center',
    justifyContent: 'center',
    filter: 'blur(1px)'
  },
  bigImage: {
    flex: 1,
    backgroundPosition: 'center',
    width: 1080,
    height: 720,
    backdropFilter: 'blur(8px)'
  },
  image: {
    flex: 1,
    width: 480,
    height: 720,
    justifyContent: 'center'
  },
  field: {
    flex: 1,
    height: 2,
    borderColor: 'gray',
    borderWidth: 1,
    backgroundColor: 'white'
  }
});

const App = () => {
  return (
    <ImageBackground source={require('./background.jpg')} style={styles.bigImage}>
      <View style={styles.container}>
        <ImageBackground source={require('./background.jpg')} resizeMode="cover" style={styles.image}>
          <Text className='text'>Some text</Text>
          <View>
            <Text>Some more text</Text>
            <Image
              source={{
                uri: 'https://reactnative.dev/docs/assets/p_cat2.png',
              }}
              style={{ width: 200, height: 200 }}
            />
          </View>
          <TextInput style={styles.field} defaultValue="You can type in me" />
        </ImageBackground>
      </View></ImageBackground>
  );
}

export default App;
